import React, { Component } from 'react';
import '../../assets/css/ControlCenter/Tab.scss';
import TabBtn from "./TabBtn";

class Tab extends Component {

    render() {
        const { switchTab, currentTab } = this.props;

        return(
            <div className="tab">
                <TabBtn btnName="Style"
                        switchTab={switchTab}
                        currentTab={currentTab}/>
                <TabBtn btnName="Export"
                        switchTab={switchTab}
                        currentTab={currentTab}/>
            </div>
        )
    }


}

export default Tab;
